import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import { Route, Routes } from "react-router";


import HomePage from "./pages/HomePage";  // Replace with your actual page components
import TaskPage from "./pages/TaskPage";  // Replace with actual paths
import NotFound from "./pages/NotFound";  // Fallback for invalid routes

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/tasks" element={<TaskPage />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
};

export default App;
